import React from 'react'

export default function navbar() {
  return (
    <nav className="bg-blue-600 text-white py-4 px-8 shadow-md">
      <div className="container mx-auto flex justify-between items-center">
        {/* Website Name */}
        <h1 className="text-xl font-bold">CloudNotes</h1>

        {/* Navigation Links */}
        <div className="space-x-4">
          <button className="bg-white text-blue-600 px-4 py-2 rounded-md font-medium hover:bg-blue-100 transition">
            Login
          </button>
          <button className="bg-white text-blue-600 px-4 py-2 rounded-md font-medium hover:bg-blue-100 transition">
            Signup
          </button>
        </div>
      </div>
    </nav>
  )
}
